import React from 'react';
import {useState} from 'react';
import '../App.css';
import { Link } from "react-router-dom";



class Register extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {

        return(//obviously needs more added
            <header className="App-header">
                <img src="images/Nooth_DnD.png" width='300' alt="logo" onClick={() => setButtonText("baba")}/>
                <h1 className="title">
                    Sign Up
                </h1>
                <form className="Form">
                    <label htmlFor="fullname" className="tbLabel">Full Name: 
                    <input type="name" id="fullname" name="fullname"/></label><br/>
                    <label htmlFor="email" className="tbLabel" name="tbLabel">Email: 
                    <input type="email" id="email" name="email"/></label><br/>
                    <label htmlFor="username" className="tbLabel" name="tbLabel">Username: 
                    <input type="text" id="username" name="username"/></label><br/>
                    <label htmlFor="password" className="tbLabel" name="tbLabel">Password: 
                    <input type="password" id="password" name="password"/></label><br/>
                </form><br/>
                <button name="submit">
                    Submit
                </button><br/>
                <button name="next" variant="outlined">
                    <Link to="/SomePage">
                        Go to some page
                    </Link>
                </button>
            </header>
            )
    }
}

export default Register;
